import React, { Suspense } from "react"
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom"
import "./App.css"

const Navbar = React.lazy(() => import("./components/navbar.jsx"))

const Home = () => {
  return <h5>Home</h5>
}

const Blog = () => {
  return <h5>Blog</h5>
}

function App() {
  return (
    <Router>
      <div className="App">
        {/* <Suspense fallback={<div>Navbar is loading</div>}> */}
        <Navbar />
        {/* </Suspense> */}
        <header className="App-header">
          <Routes>
            <Route end path="/" element={<Home />}></Route>
            <Route end path="/blog" element={<Blog />}></Route>
          </Routes>
        </header>
      </div>
    </Router>
  )
}

export default App
